export default new Router({
  routes: [
    {
      path: '/Library',
      name: 'Library',
      component: Home
    },
    {
      path: '/',
      name: 'Hot',
      alias: '/Hot',
      component: Home
    },
    {
      path: '/Movies',
      name: 'Movies',
      component: Home
    },
    {
      path: '/Anime',
      name: 'Anime',
      component: Home
    },
    {
      path: '/Manga',
      name: 'Manga',
      component: Home
    }
  ]
})
